import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { Link } from "react-router-dom";

import MainNavbar from '../MainNavbar.js';
import PastEvents from './PastEvents.js';
import UpcomingEvents from './UpcomingEvents.js';

import img1 from '../../images/events/cme-talk-for-doctors-the-sporting-knee/subimg1.jpg';

function Events() {

    return(
        <>
            <MainNavbar activeTab="/events"/>
            <div className="container section events">
                <div className="row">
                    <div className="col side-title">
                        <h3>Events</h3>
                        <hr/>
                    </div>
                </div>


                <UpcomingEvents/>

                <PastEvents/>

            </div>
        </>
    );
}

export default Events;
